import React from 'react';
import Particles from "react-particles-js";
import logo from "../images/logo.png";


function About() {
    return (
        <>
            <Particles
                params={{
                    particles: {
                        number: {
                            value: 70,
                            density: {
                                enable: true,
                                value_area: 1000
                            }
                        },
                        shape: {
                            type: "circle",
                            stroke: {
                                width: 6,
                                color: "#ffffff"
                            }
                        },
                        color: {
                            value: "#000000"
                        },
                        line_linked: {
                            width: "2"
                        }
                    }
                }}
            />





            <div className="about-container">
                <div className="about-inner-container">
                    <h1>About me</h1>
                    <p>I am currently a 3rd year Btech </p>
                </div>
            </div>
        </>
    )
}

export default About;
